import React, { Component } from 'react';
import Login from "./Login";
import Cadastro from "./Cadastro";

class TelaInicial extends Component {
    constructor(props) {
        super(props);

        this.state = {
            rota: 'Login'
        }
        this.changeRota = this.changeRota.bind(this);
    }

    changeRota (val) {
        this.setState({rota:val})
    }

    render () {
        if (this.state.rota === 'Login') {
            return <Login onCadastrar={(event) => this.changeRota('Cadastro')}/>;
        } else if (this.state.rota === 'Cadastro') {
            return <Cadastro onVoltar={(event) => this.changeRota('Login')}/>;
        }
    }
}

export default TelaInicial;
